import React from 'react';
import "SideDrawer.css";

function SideDrawer(props){
    return(
        <nav className="side-drawer">
            <li>Home</li>
            <li>Movies</li>
            <li>Tv Shows</li>
            <li>Search</li>
        </nav>
    )
}
export default SideDrawer;
